    false,nt"url": null,nt"notes": "Preliminary maps of liquefaction susceptibility
    for the Renton and Auburn 7.5' quadrangles, Washington, Open File Report 92-7. Liquefaction
    susceptibility maps are presented for the Renton and Auburn 7.5' topographic quadrangles.
    These maps are based on analyses of 140 geotechnical borings; these data were obtained
    from the Washington Department of Transportation and the King County Department
    of Building and Land Development. Four categories of geologic deposits found in
    the study area are assigned a susceptibility ranking on the basis of analysis of
    the geotechnical data and historical reports of liquefaction during the 1949 magnitude
    7.1 Olympia and 1965 magnitude 6.5 Seattle-Tacoma earthquakes.",nt"license_title":
